import React from 'react';
import { Image, StyleSheet, View } from 'react-native';

export default function NavigationBar() {
    return (
        <View style={styles.container}>
            <Image
                style={styles.icons}
                source={require('../../../assets/icons/file-signature-solid.png')}
            />
            <Image
                style={styles.icons}
                source={require('../../../assets/icons/envelope-solid.png')}
            />
            <View style={styles.box}> 

            </View>
            <Image
                style={styles.icons}
                source={require('../../../assets/icons/home-solid.png')}
            />
            <Image
                style={styles.icons}
                source={require('../../../assets/icons/hotel-solid.png')}
            />
            <Image
                style={styles.icons}
                source={require('../../../assets/icons/user-solid.png')}
            />
        </View>
    )
};

const styles = StyleSheet.create({
    container: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: 10,
        zIndex: 3,
        backgroundColor: '#D98236',
        alignSelf: 'flex-end'
      },
      icons: {
        zIndex: 2
      },
      box: {
        width: 100,
        height: 100,
        backgroundColor: '#D98236',
        borderRadius: 50,
        position: 'absolute',
        left: 150,
        bottom: 5,
        zIndex: 1
      }
});
